import React from "react";

import "./Team.css";

import Member from "./Member";

import member from "../../assets/member.png";

const members = [
  {
    name: "Serghei",
    surname: "Hmeli",
    role: "Front End Developer",
    imgSrc: member,
  },
  {
    name: "Alexandr",
    surname: "Vopilov",
    role: "Backend Developer",
    imgSrc: member,
  },
  {
    name: "Leonid",
    surname: "Shaptefrati",
    role: "Android Developer",
    imgSrc: member,
  },
];

const Team = () => {
  return (
    <div id="team">
      <h3 className="team-heading">MEET OUR TEAM</h3>
      {members.map((member) => (
        <Member
          name={member.name}
          surname={member.surname}
          role={member.role}
          imgSrc={member.imgSrc}
        />
      ))}
    </div>
  );
};

export default Team;
